import * as React from 'react';
import {Link} from "react-router-dom";
import './sidenav.css';

export function SideNav() {
    const menuElements = [
        {
            title: 'Home',
            path: '/'
        },
        {
            title: 'About',
            path: '/about'
        },
        {
            title: 'Contact',
            path: '/contact'
        }
        
    ];
    return (
        <div>
            <ul className={`sideMenuOptions`}>
                {menuElements.map((element, index) => (
                    <li key={index} className={`sideMenuOption`}>

                        <Link to={element.path} className={`sideMenuOptionLink`}>
                            <span>{element.title}</span>
                        </Link>
                    </li>
                ))}
            </ul>



        </div>
    );
}
